'use strict';
class PdasMessageList {
    tag;
    children;
    addChild(item) {
        this.children.addChild(item);
    }
    getName() {
        return this.tag;
    }
    getFieldValue(name) {
        return this.children.getFieldValue(name);
    }
    getList(name) {
        return this.children.getList(name);
    }
    getGroupParamValueByParamName(name) {
        return this.children.getGroupParamValueByParamName(name);
    }
    getFields() {
        return this.children.getFields();
    }
    getGroups() {
        return this.children.getGroups();
    }
    length() {
        return this.children.length();
    }
    serialize() {
        let result;
        result = "<l n=\"" + this.tag + "\" s=\"" + (this.children.length()).toString() + "\">" + this.children.serialize() + "</l>";
        return result;
    }
    getElementType() {
        return "l";
    }
}
module.exports = PdasMessageList
